import React from 'react';
import Navbar from "../Components/Navbar";

const Flight = () => {
    return (
        <>
        <Navbar />
        <section id="flight">
            <div className="flight-img">
                <img src="img/bujuru.jpg" alt="bujuru castle" />
            </div>

        </section>
        </>
    )
};
export default Flight;
